DROP TABLE IF EXISTS `messages`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `messages` (
  `id` int(60) NOT NULL AUTO_INCREMENT COMMENT '答案点赞id',
  `answer_like_id` int(20) DEFAULT NULL,
  `comment_like_id` int(20) DEFAULT NULL COMMENT '评论点赞id',
  `answer_comment_like_id` int(20) DEFAULT NULL COMMENT '答案评论id',
  `post_like_id` int(11) DEFAULT NULL,
  `member_follow_id` int(11) DEFAULT NULL COMMENT '关注表id',
  `post_comment_id` int(11) DEFAULT NULL,
  `answer_comment_id` int(11) DEFAULT NULL,
  `be_like_member_id` int(20) NOT NULL COMMENT '被点赞的用户id',
  `is_readed` int(1) NOT NULL DEFAULT '0' COMMENT '是否已经读取1是0否',
  `content` char(255) DEFAULT NULL COMMENT '点赞类型_id',
  `updated_at` datetime DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' ON UPDATE CURRENT_TIMESTAMP,
  `member_id` int(20) DEFAULT NULL COMMENT '点赞的用户id',
  `type` int(11) DEFAULT NULL COMMENT '1是点赞消息2是关注消息3是点评消息4回复消息5系统消息',
  `system_message_detail_id` int(50) DEFAULT NULL COMMENT '系统消息详情表id',
  `content_type` int(1) DEFAULT NULL COMMENT '1视频2文章3问答',
  `post_id` int(11) DEFAULT NULL COMMENT '资源id',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `answer_like_id` (`answer_like_id`,`comment_like_id`,`answer_comment_like_id`,`post_like_id`,`be_like_member_id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=2571 DEFAULT CHARSET=utf8 COMMENT=' 点赞消息表，用于统计答案点赞表，答案评论表和评论点赞表';
/*!40101 SET character_set_client = @saved_cs_client */;

