INSERT INTO `posts` VALUES (308,'标题啊啊','好的家电家具想你呢经济学基础积极参加你姐姐纯牛奶吃血继界限继续继续难看小鸡小鸡橡胶厂你呢血继界限金翅鸟厦门',NULL,2,55,1,1,0,0,'2019-10-22 17:41:39',0,'2019-11-22 10:03:55','2019-11-22 18:03:55','2019-11-22 18:03:55',NULL),(309,'环保回收',NULL,'http://qiniuyun.yi8kk3.cn/temp_uuid_9381b977ca1c02a6bbce85eb890b3269.mp4',1,60,1,1,0,65,'2019-11-30 17:27:17',0,'2019-12-06 04:13:24','2019-10-28 09:27:23',NULL,'00:15'),(310,'大的两节，小的三节，长长短短，二十八节。 （打一人体器官）',NULL,NULL,3,60,1,1,0,0,'2019-10-22 17:53:20',0,'2019-10-22 09:53:20','2019-10-22 17:53:20',NULL,NULL),(311,'秋深','秋天越来越冷，已失去了她初见的美好，一场秋雨像从冰箱里拿出的冷饮浇向大地，人们开始拿出御寒的衣物乖乖地套上。流浪汉在街角瑟瑟发抖，人们不愿意自己变成那个惨样，红着鼻子吸着鼻涕。',NULL,2,60,1,1,0,0,'2019-10-22 17:55:24',0,'2019-10-22 09:55:24','2019-10-22 17:55:24',NULL,NULL),(312,'测试',NULL,'http://qiniuyun.yi8kk3.cn/c7f71a3262b3889bcee841bd7a5ed284.mp4',1,55,1,1,0,39,'2019-10-22 18:56:30',0,'2019-12-12 01:39:54','2019-10-22 18:56:30',NULL,'05:30'),(313,'唱歌',NULL,'http://qiniuyun.yi8kk3.cn/0f48cbeeb1c136e65c3699d2bb90da15.mp4',1,54,1,1,0,32,'2019-10-22 21:25:52',0,'2019-12-01 07:44:45','2019-12-01 15:44:45','2019-12-01 15:44:45','00:15'),(314,'唱歌',NULL,'http://qiniuyun.yi8kk3.cn/0f48cbeeb1c136e65c3699d2bb90da15.mp4',1,54,1,1,0,27,'2019-10-22 21:27:20',0,'2019-12-01 07:44:50','2019-12-01 15:44:50','2019-12-01 15:44:50','00:15'),(315,'风景','海滨城市犹如童话般世界，蓝天白云晴空万里，哼着小曲唱着歌，远眺未来，或许那年也会如此这般美丽，多娇!',NULL,2,54,1,1,0,0,'2019-10-22 21:40:58',0,'2019-10-22 13:40:58','2019-10-22 21:40:58',NULL,NULL),(316,'像鸟一样飞翔','昂头，一身柔滑的羽毛，或许不是那么多彩，但在这世界上有谁比我美丽。\n俯首，只因脚下水洼里有我的食物。远眺，蓝天下任意翱翔。',NULL,2,54,1,1,0,0,'2019-10-22 21:47:29',0,'2019-10-22 13:47:29','2019-10-22 21:47:29',NULL,NULL),(317,'英语歌曲',NULL,'http://qiniuyun.yi8kk3.cn/5a764ad782ed4b38f9b4f44fe7ba1651.mp4',1,54,1,1,0,20,'2019-10-22 21:53:15',0,'2019-12-01 07:44:56','2019-12-01 15:44:56','2019-12-01 15:44:56','00:14'),(318,'苏东坡为何说居住可以无肉，不可以无竹','竹，茂密青翠，挺拔。一处好风景。',NULL,2,54,1,1,0,0,'2019-10-22 22:07:16',0,'2019-10-22 14:07:16','2019-10-22 22:07:16',NULL,NULL),(319,'祖国',NULL,'http://qiniuyun