好，感谢您使用仆龙学习并关注仆龙小助手，参加答题活动。本次活动需要在线九千万用户才开始，仆龙用户数量每天正以飞一般速度增加中，仆龙小助手会不时播报用户在线数量，敬请关注，不要错过答题活动哦',NULL,2,54,1,1,0,0,'2019-11-06 14:27:56',0,'2019-11-06 06:27:56','2019-11-06 14:27:56',NULL,NULL),(380,'骑士','骑士的世界你不懂',NULL,2,54,1,1,0,0,'2019-11-14 18:56:38',0,'2019-11-14 10:56:38','2019-11-14 18:56:38',NULL,NULL),(381,'骑士','骑士的世界你不懂',NULL,2,54,1,1,0,0,'2019-11-14 18:56:38',0,'2019-11-14 10:56:38','2019-11-14 18:56:38',NULL,NULL),(382,'哈巴','嘎嘎',NULL,2,73,1,1,0,0,'2019-11-15 22:15:33',0,'2019-11-15 14:15:33','2019-11-15 22:15:33',NULL,NULL),(383,'还要坚持吗？','1.不要被任何人打乱自的脚步，因为没有谁会像你一样清楚和在乎自己梦想。\n\n　　2.没有人可以打倒我，除非我自己先趴下!\n\n　　3.你要记住你不是为别人而活，你是为自己而活。\n\n　　4.当你对自己诚实的时候，世界上就没有人能够欺骗得了你。\n\n　　5.人生的上半场打不好没关系，还有下半场，只要努力。',NULL,2,73,1,1,0,0,'2019-11-15 22:18:57',0,'2019-11-15 14:18:57','2019-11-15 22:18:57',NULL,NULL),(384,'艾宾浩斯记忆遗忘曲线','德国心理学家艾宾浩斯(H.Ebbinghaus）研究发现，遗忘在学习之后立即开始，而且遗忘的进程并不是均匀的。最初遗忘速度很快，以后逐渐缓慢。他认为\"保持和遗忘是时间的函数\"，他用无意义音节作记忆材料，用节省法计算保持和遗忘的数量，并根据他的实验结果绘成描述遗忘进程的曲线，即著名的艾宾浩斯记忆遗忘曲线。',NULL,2,73,1,1,0,0,'2019-11-16 10:57:07',0,'2019-11-16 02:57:07','2019-11-16 10:57:07',NULL,NULL),(385,'坚持一件小事才是一件大事','如果连我自己的人生都不能奋力一搏的话，那岂不是太废柴了吗？回首往事，我自己觉得，最大的心酸不会是我做不到。而是，我本来可以的。如果一辈子只做一件事，我觉得那件事一定是很了不起。',NULL,2,73,1,1,0,0,'2019-11-17 19:15:31',0,'2019-11-17 11:15:31','2019-11-17 19:15:31',NULL,NULL),(386,'坚持一件小事才是一件大事','如果连我自己的人生都不能奋力一搏的话，那岂不是太废柴了吗？回首往事，我自己觉得，最大的心酸不会是我做不到。而是，我本来可以的。如果一辈子只做一件事，我觉得那件事一定是很了不起。',NULL,2,73,1,1,0,0,'2019-11-17 19:15:32',0,'2019-11-17 11:15:32','2019-11-17 19:15:32',NULL,NULL),(387,'既然不是天才就只有努力','我们这个世界上有一些天才。他们过目不忘、耳听八方。他们三岁弹琴、八岁谱曲。但聪明，这并不是人成功的充分条件，真正能让人成功的，是勤奋，对目标始终不放弃，并日复一日的练习！',NULL,2,73,1,1,0,0,'2019-11-17 19:16:24',0,'2019-11-17 11:16:24','2019-11-17 19:16:24',NULL,NULL),(388,'只有行动起来，一切才会变好','不要听到你嘴里的积极口号，不要看到你在受伤之后的眼泪。我要看到你平地一声雷的蛰伏，看到你特立独行却不被孤立的魅力，看到你与世无争却有迹可循的野心，看到你说堕落，却又不自甘堕落的自制力。',NULL,2,73,1,1,0,0,'2019-11-17 19:17:36',0,'2019-11-17 11:17:36','2019-11-17 19:17:36',NULL,NULL),(389,'真正的绝望是内心的迷茫','有一种成功，叫永不言弃。有一种成功，叫继续努力。人们都说：过去的习惯，决定今天的你。过去的懒惰，决定今天的一败涂地。人哪，你可以失败，也可以从失败中站起。决不能习惯失败，因为你要知道，身体的疲惫，不是真正的疲惫。精神上的疲惫，才是真的劳累。真正的绝望，是内心的迷茫。',NULL,2,73,1,1,0,0,'2019-11-17 19:18:59',0,'2019-11-17 11:18:59','2019-11-17 19:18:59',NULL,NULL),(390,'不管怎样，也要坚持住啊','当你很累很累的时候，应该闭上眼睛做深呼吸，告诉自己你应该坚持得住，不要这么轻易的否定你自己，谁说你没有好的未来，关于明天的事后天才知道…即使没有人为你鼓掌，也要优雅的谢幕，感谢自己认真的付出。',NULL,2,73,1,1,0,0,'2019-11-17 19:20:04',0,'2019-11-17 11:20:04','2019-11-17 19:20:04',NULL,NULL),(391,'学好数学','数学需要熟练度 最好天天刷题',NULL,2,79,1,1,0,0,'2019-11-18 16:49:11',0,'2019-11-18 08:49:11','2019-11-18 16:49:11',NULL,NULL),(392,'学习英语','每天早上背单词是必须的',NULL,2,79,1,1,0,0,'2019-11-18 16:54:24',0,'2019-11-18 08:54:24','2019-11-18 16:54:24',NULL,NULL),(393,'语文背诵','晚上睡觉之前背书效果也很好的',NULL,2,79,1,1,0,0,'2019-11-18 19:47:59',0,'2019-11-18 11:47:59','2019-11-18 19:47:59',NULL,NULL),(394,'放下手机','现在很多小学生不喜欢写作业 希望在写作业时能够将手机锁起来 这样可以容易集中精力',NULL,2,79,1,1,0,0,'2019-11-18 19:49:38',0,'2019-11-18 11:49:38','2019-11-18 19:49:38',NULL,NULL),(395,'大学深夜的食堂 很多学子还没有放学 很多人在讨论学习',NULL,'http://qiniuyun.yi8kk3.cn/2dd81295-53b9-4931-9ed1-700c3c91e2d2.mp4',1,79,1,1,0,0,'2019-11-18 19:51:55',0,'2019-11-18 11:51:55','2019-11-18 19:51:55',NULL,'00:13'),(396,'Excel小技巧：建立分离型三维饼图','1、选择数据，记得行和列的表头都要选定\n2、依次选择“插入”-“饼图”-“分离型三维饼图”\n3、导入的饼图比较原始，还需要调整才更适合需求\n4、点击饼图，移动到最右边缘，可以直接拉长，或移动到最下边缘，可以直接拉宽\n5、点击其中一组饼图，右击，添加数据标签可以添加饼图的数据\n6、数据添加后，会在对应的饼图上显示数据标签',NULL,2,73,1,1,0,0,'2019-11-18 22:54:48',0,'2019-11-18 14:54:48','2019-11-18 22:54:48',NULL,NULL),(397,'在Excel中如何快速设置小数位数','1、确定需要设置的单元格区域；\n\n2、点击菜单中的开始按钮，找到数据，点击增加小数位置的图标，点击一次，就增加一位数。',NULL,2,73,1,1,0,0,'2019-11-18 22:57:23',0,'2019-11-18 14:57:23','2019-11-18 22:57:23',NULL,NULL),(398,'如何在Excel中设置小数位数','方法一、打开文件所在位置，选中要设置小数位数的单元格区域；单击（开始）选项卡（数字）组中的对话框启动器\n\n方法二、我们还可以选中要设置小数位数的单元格区域；单击鼠标右键，在下拉列表中选择（设置单元格格式）\n弹出（设置单元格格式）对话框，在（数字）选项卡的（分类）列表中选择（数值）选项；在右侧（小数位数）微调框中设置小数位数，本例中设置为2；设置完成后单击（确定）按钮\n\n返回工作表，即可看到所选单元格区域都自动添加了2位小数',NULL,2,73,1,1,0,0,'2019-11-18 23:03:13',0,'2019-11-18 15:03:13','2019-11-18 23:03:13',NULL,NULL),(399,'学习小技巧','在学习的时候 保持开心的心态很重要 有利于提高学习效率',NULL,2,79,1,1,0,0,'2019-11-19 16:41:51',0,'2019-11-19 08:41:51','2019-11-19 16:41:51',NULL,NULL),(400,'学习小技巧','背诵单词时 可以根据单词规律背诵相关单词 可以快速记忆',NULL,2,79,1,1,0,0,'2019-11-19 16:43:37',0,'2019-11-19 08:43:37','2019-11-19 16:43:37',NULL,NULL),(401,'学习小技巧','英语就如同汉语一样 为什么我们可以学好汉语呢 因为我们每天都在听 所以英语也一样的 多听',NULL,2,79,1,1,0,0,'2019-11-19 16:45:39',0,'2019-11-19 08:45:39','2019-11-19 16:45:39',NULL,NULL),(402,'大学晚间',NULL,'http://qiniuyun.yi8kk3.cn/5c261611-c3a4-4e70-a204-7390596d2217.mp4',1,79,1,1,0,0,'2019-11-19 21:33:42',0,'2019-11-19 13:33:42','2019-11-19 21:33:42',NULL,'00:10'),(403,'学习小技巧','学习需要坚持 例如每天晚上背十个单词',NULL,2,79,1,1,0,0,'2019-11-19 21:35:07',0,'2019-11-19 13:35:07','2019-11-19 21:35:07',NULL,NULL),(404,'学习小技巧','每天早上背单词 记忆力很好 效率高',NULL,2,79,1,1,0,0,'2019-11-20 07:13:21',0,'2019-11-19 23:13:21','2019-11-20 07:13:21',NULL,NULL),(405,'人为什么要读书？（上）','读书为了什么？为什么要读书？智者、大学问家、每个爱读书的人、站在阅读\n门槛处张望的人都会问自己这个问题。关于为什么要读书，这些理由足矣打动我：\n--1--钱钟书说\n化书卷见闻为吾性灵。\n--2--英国唯物主义的第一个创始人培根说\n “读书使人成为完善的人。读书不是为了雄辩和驳斥，也不是为了轻信和盲从，而是为了思考和权衡。”\n--3--余秋雨说\n阅读的最大理由是摆脱平庸。平庸是一种被动而又功利的谋生态度。平庸者什么也不缺少，只是无感于外部世界的精彩、人类历史的厚重、终极道义的神圣、生命涵义的丰富。',NULL,2,73,1,1,0,0,'2019-11-20 11:26:06',0,'2019-11-20 03:26:06','2019-11-20 11:26:06',NULL,NULL),(406,'人为什么要读书？（下）','-6--周国平说\n“读书是一辈子的事情。一个养成了读书习惯的人，他的世界是更广阔更丰富的。”\n--7--白岩松说\n “读书读久了你总会信一些什么，信一些什么就有了敬，有了畏，因为信仰我认为最重要的是 敬畏 二字。”\n--8--余世存说\n人可以在阅读中安顿自己。\n--9--伏尔泰说\n书读的越多而不加思索，你就会觉得你知道得很多；但当你读书而思考越多的时候，你就会清楚地看到你知道得很少。\n--10--罗曼罗兰说\n从来没有人为了读书而读书，只有在书中读自己，在书中发现自己，或检查自己。',NULL,2,73,1,1,0,0,'2019-11-20 11:28:07',0,'2019-11-20 03:28:07','2019-11-20 11:28:07',NULL,NULL),(407,'测试','你跟你',NULL,2,80,1,1,0,0,'2019-11-22 09:40:24',0,'2019-11-22 01:40:24','2019-11-22 09:40:24',NULL,NULL),(408,'关于大学四级考试技巧','作为一个大学生，对于四六级考试当然很重视，听过一些学长学姐们的建议，对与四级考试有了一些心以下是对提高听力水平的一些技巧',NULL,2,78,1,1,0,0,'2019-11-22 11:14:50',0,'2019-11-22 03:14:50','2019-11-22 11:14:50',NULL,NULL),(409,'大学生活里该有的忙碌',NULL,'http://qiniuyun.yi8kk3.cn/2019-10-22/11-15-30-VID_20191120_154858.mp4',1,78,1,1,0,16,'2019-11-22 11:15:43',0,'2019-12-24 06:38:40