就紧张了，吞吞吐吐的结束了，下',NULL,2,78,1,1,0,0,'2019-12-01 12:59:59',0,'2019-12-01 04:59:59','2019-12-01 12:59:59',NULL,NULL),(514,'学习小技巧1','1目标学习法，明确目标，才能更有效率的学习。\n2问题学习法，带着问题学习，有利于集中注意力。',NULL,2,73,1,1,0,0,'2019-12-01 14:15:09',0,'2019-12-01 06:15:09','2019-12-01 14:15:09',NULL,NULL),(515,'学会储存','人生要学会储蓄。你若耕耘，就储存了一次丰收;你若努力，就储存了一个希望;你若微笑，就储存了一份快乐。你能支取什么，取决于你储蓄了什么。没有储存友谊，就无法支取帮助;没有储存学识，就无法支取能力;没有储存汗水，就无法支取成功。想要有取之不尽的幸福，就要每天储蓄感恩和付出。',NULL,2,73,1,1,0,0,'2019-12-01 14:19:24',0,'2019-12-01 06:19:24','2019-12-01 14:19:24',NULL,NULL),(516,'每日一句','What you disdained may be the life other people strive for, and the failed life you meant may be what other people have painstakingly earned.\n\n你所嫌弃的，可能是别人拼命想要得到的。你以为失败的人生，也许是别人努力活着的结果。',NULL,2,73,1,1,0,0,'2019-12-01 16:43:43',0,'2019-12-01 08:43:43','2019-12-01 16:43:43',NULL,NULL),(517,'学习也要讲方法','1课认真听讲，集中注意力。做好课堂笔记。有时，老师讲一些重点内容，要及时记下来，利于课后复习时查阅。\n2勤于思考，积极举手发言，表达观点，发言时要有信心，偶尔说错了没有关系。错了，老师同学会订正，这样你会记得更牢。\n3作好课后复习，知道温故而知新吗？课后，要尽量把作业做的快而好。做好后，阅读一些好书或报纸，增加我们的阅读量。\n4双休日，我们一定要做好读书笔记，还可以背诵一些书中的好段落，以便在写作文时灵活使用。\n5要做好预习工作。预习时，认真反复地朗读课文，体会文章的用意。',NULL,2,73,1,1,0,0,'2019-12-01 17:28:49',0,'2019-12-01 09:28:49','2019-12-01 17:28:49',NULL,NULL),(518,'影响学习的因素','1与目标学习者相关的内容\n完成这些内容的步骤是，先评估员工对自身发展的期望，再对员工的过去进行分析。\n2多种学习方法，如课堂学习、网络学习以及实践练习\n这确保了学习过程和学习者不会陷入一种学习模式。\n3提高学习效果的后续行动\n在实施训练几周后，为员工提供基于某个专题的半天研讨会；或是发送相关文章和电子邮件给员工，以保持他们学习的持续性。',NULL,2,73,1,1,0,0,'2019-12-01 17:31:14',0,'2019-12-01 09:31:14','2019-12-01 17:31:14',NULL,NULL),(519,'学习坚持不下去了怎么办？（上）','人都是有惰性的，将自律和懒散的人区分开来主要看，能不能坚持。那么学习坚持不下去了怎么办？\n1不要在精疲力竭的时候学习\n学习疲惫时，不如让自己放松20-30分钟，先洗个澡，穿令自己放松的睡衣再去学习。吃点水果补充维生素，科学研究表示咀嚼能让人放松大脑，释放多巴胺，利于创造愉快的学习环境。',NULL,2,73,1,1,0,0,'2019-12-01 17:49:15',0,'2019-12-01 09:49:15','2019-12-01 17:49:15',NULL,NULL),(520,'学习坚持不下去了怎么办？（2）','2在专注模式和发散模式交替进行\n大脑学习时一般分为两种模式：专注模式和发散模式。专注模式在之前学习中，老师一直强调。我们学习新知识点时，一般用专注模式，全身心学习。但总会有瓶颈的时候，我们可以切换到发散模式如慢跑，听音乐，冥想。',NULL,2,73,1,1,0,0,'2019-12-01 17:49:54',0,'2019-12-01 09:49:54','2019-12-01 17:49:54',NULL,NULL),(521,'学习坚持不下去了怎么办？','3、更换不同的学习场景\n\n有多项研究表示和实验表示，环境背景的变化大大提高记忆力。作为高考生，我们每天花费十个小时在学校，甚至更多。几乎没有娱乐，每天面对同样的黑板、书桌、前桌的后脑勺。这时，建议同学换个不同的地方学习一段时间，比如去公园、奶茶店、图书馆等地方学习。在公共场合学习还有一个好处，会激发的人社会定位心理，在公共场合捧着本书不看的话，怕别人认为自己在装逼，于是会强迫自己投入知识的海洋，这样一来不管是散步的老人，喝奶茶的情侣都起到了你的监督作用。',NULL,2,73,1,1,0,0,'2019-12-01 17:50:28',0,'2019-12-01 09:50:28','2019-12-01 17:50:28',NULL,NULL),(522,'学习坚持不下去了怎么办？（4）','4.及时更换学习科目\n\n我们的时间非常紧迫，一直把时间用在一个科目上容易让人感到沮丧，学习动力下降，这时候最容易产生‘真的坚持不下去了’的情绪。数学这个大头，一写就是几个小时，思来想去解不出一个大题，那我们就要考虑适时的更换科目了，试试背诵，看书或听课程，试试用思维导图归纳总结概念。',NULL,2,73,1,1,0,0,'2019-12-01 17:51:23',0,'2019-12-01 09:51:23','2019-12-01 17:51:23',NULL,NULL),(523,'费曼技巧a','a在纸上写下一个科目，以及你对该科目所了解的内容，想象你即将要把这一门科目教给八岁的孩子。当你在写出一个知识点时只用小孩子能理解的简单语言，那么你会迫使自己更加深入地理解这一概念，并简化知识点之间的关系和联系。',NULL,2,73,1,1,0,0,'2019-12-01 17:58:10',0,'2019-12-01 09:58:10','2019-12-01 17:58:10',NULL,NULL),(524,'费曼技巧bc','b如果你做的异常艰辛，说明这是你原本没有掌握的地方。别紧张，这是你学习的机会。拿出课本重新学习这一概念，直到你能用简单语言解释它们。c你已经拥有了较为完整的笔记，将它整理成一个流畅简单的故事，将故事读出来，小声读给自己听或读给同学听，甚至可以读给花花草草听。如果其中部分听起来令人困惑，这就代表你在这一领域仍需进一步的工作。',NULL,2,73,1,1,0,0,'2019-12-01 17:58:43',0,'2019-12-01 09:58:43','2019-12-01 17:58:43',NULL,NULL),(525,'风雨过后，必定有温暖的阳光照耀',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/7-6-13-VID_20191201_154227.mp4',1,78,1,1,0,3,'2019-12-02 07:06:21',0,'2019-12-16 03:12:50','2019-12-02 07:06:21',NULL,NULL),(526,'早上起来集体锻炼身体也是很有必要的',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/7-7-4-VID_20191202_070644.mp4',1,78,1,1,0,7,'2019-12-02 07:07:16',0,'2019-12-24 04:45:00','2019-12-02 07:07:16',NULL,NULL),(527,'夜跑到马路上，真的是很冷啊！',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/7-7-58-VID_20191201_200334.mp4',1,78,1,1,0,7,'2019-12-02 07:08:08',0,'2019-12-24 04:44:32','2019-12-02 07:08:08',NULL,NULL),(528,'现在的公交车等车系统都这么厉害了吗？',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/7-8-26-VID_20191201_202818.mp4',1,78,1,1,0,7,'2019-12-02 07:08:37',0,'2019-12-24 05:51:28','2019-12-02 07:08:37',NULL,NULL),(529,'雨过后的天气，早晨就是这么美',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/7-9-46-VID_20191202_070929.mp4',1,78,1,1,0,8,'2019-12-02 07:09:51',0,'2019-12-16 03:12:45','2019-12-02 07:09:51',NULL,NULL),(530,'要做一个自信的人✊',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/10-33-13-SVID_20191201_203402_1.mp4',1,77,1,1,0,24,'2019-12-02 10:35:08',0,'2019-12-24 04:58:36','2019-12-02 10:35:08',NULL,NULL),(531,'要做一个自信的人✊',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-2/10-33-13-SVID_20191201_203402_1.mp4',1,77,1,1,0,0,'2019-12-02 10:35:08',0,'2019-12-02 02:35:18','2019-12-02 10:35:18','2019-12-02 10:35:18',NULL),(532,'吃v好v好','刚吃好v好季节拒绝过好吃v哈哈v几句回家剑及屦及v几句讲几句v几句v句几哈句u句vuvVBhiivv顾vvuvuuvuuvuv好vU盾打到的人多点点烦烦烦烦烦烦烦发发红包风风光光GGGG哥哥跟给给你发GGGG姑姑姑父哥哥我GG刚刚搞好姑姑家哥哥过过几天GG滚滚滚哥哥们哥哥哥咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕姑姑姑父咕咕咕咕咕咕咕咕咕GG乖乖吃饭哥哥给搞活动咕咕咕姑姑搞个滚滚滚尴尬不乖乖给他尴尬的咕咕咕尴尬什么GG哥哥的乖乖听话乖乖跟她尴尬高高给她咕咕咕刚刚看到GG咕咕咕滚滚滚古古怪怪嘎嘎嘎GG咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕咕姑姑家滚滚滚刚刚看到的吗好的呢呢',NULL,2,80,1,1,0,0,'2019-12-02 14:03:20',0,'2019-12-02 06:03:20','2019-12-02 14:03:20',NULL,NULL),(533,'人的一生都值得学习','人一生下来就开始学习，经过各种各样的学习，才能懂得怎么做人，怎么生存……\n    我们每个人在人生的道路上摸爬滚打，总想在自己的有生之年干一番事业，做点什么？\n\n我们每个人都是在学习中长大，都是在学习中进步，用学到的知识求生存，求上进，求生财之道，求得在社会上立于不败之地。\n\n人的一生不仅要学好文化，而且要学会做人的道理和为人处事。要学会忍让，人世间忍一口气，风平浪静，退一步海阔天空；忍，万事都能消除。忍就是会处理事物，会化解茅盾。用智慧、能力让大事化小、小事化无。\n\n人的一生要学习，要生活、要生存、要生命，学会忍，可以认清世间的好坏、善恶、美丑、可以明辨是非。\n\n人要学会和人沟通，相互了解、相互体谅、相互帮助，我们都是中华儿女，都是龙的传人，在生活生存中要与人沟通，学会容忍他人，学会与人沟通，那么你就什么东西都学会了。反之将什么事情都做不了，将会一事无成！\n\n人一辈子都在学习，必须认真学习才能学到知识，才能懂得做人的道理，才能立于不败之地，才能成功！',NULL,2,73,1,1,0,0,'2019-12-02 22:31:15',0,'2019-12-02 14:31:15','2019-12-02 22:31:15',NULL,NULL),(534,'你知道一棵树上可以结四十种果实吗\n✌✌',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/7-59-29-SVID_20191203_074050_1.mp4',1,77,1,1,0,11,'2019-12-03 08:00:44',0,'2019-12-21 02:46:41','2019-12-03 08:00:44',NULL,NULL),(535,'朝阳代表希望，送给考研学子',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/8-31-1-VID_20191202_072645.mp4',1,78,1,1,0,8,'2019-12-03 08:31:25',0,'2019-12-16 05:38:35','2019-12-03 08:31:25',NULL,NULL),(536,'仙境？',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/8-32-4-VID_20191202_072609.mp4',1,78,1,1,0,11,'2019-12-03 08:32:29',0,'2019-12-09 12:21:06','2019-12-03 08:32:29',NULL,NULL),(537,'要上课啦！！！',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/8-33-4-VID_20191202_075116.mp4',1,78,1,1,0,9,'2019-12-03 08:33:42',0,'2019-12-24 04:44:11','2019-12-03 08:33:42',NULL,NULL),(538,'果然，城市也苏醒了',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/8-34-12-VID_20191202_165116.mp4',1,78,1,1,0,9,'2019-12-03 08:34:33',0,'2019-12-24 04:44:00','2019-12-03 08:34:33',NULL,NULL),(539,'提问：防止艾滋病到底有多重要',NULL,NULL,3,78,1,1,0,0,'2019-12-03 08:36:07',0,'2019-12-03 00:36:07','2019-12-03 08:36:07',NULL,NULL),(540,'测试',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-3/13-45-57-android_24674_20191019_112235_5745842.mp4',1,60,1,1,0,6,'2019-12-03 13:45:58',0,'2019-12-06 05:47:18','2019-12-03 13:45:58',NULL,NULL),(541,'健康管理师','健康管理师是从事个体和群体从营养和心理两方面健康的检测、分析、评估以及健康咨询、指导和危险因素干预等工作的专业人员。为了适应全面建设小康社会的需要，提高全民族的健康意识和身体素质，培养和造就健康管理人才，人力资源和社会保障部及中央电化教育馆等教育培训中心推出健康管理师岗位能力培训课程。健康管理师是国家新增职业。\n职业意义\n健康管理师是国家新增职业，可以从事医疗机构、疾病预防机构、社区健康管理、健康监测、健康评估、健康维护等相关工作。\n为了适应全面建设小康社会的需要，提高全民族的健康意识和身体素质，培养和造就健康管理人才，推出健康管理师培训课程。\n学员学完规定课程参加考试的合格者，颁发健康管理师证书。\n健康管理师是负责健康和疾病的监测、分析、评估以及健康维护和健康促进的专业人员。健康管理师是2005年10月劳动和社会保障部第四批正式发布的11个新职业之一。',NULL,2,73,1,1,0,0,'2019-12-03 15:03:55',0,'2019-12-03 07:03:55','2019-12-03 15:03:55',NULL,NULL),(542,'健康管理师申报条件','三级健康管理师报考条件\n——具备以下条件之一者可以申报三级健康管理师\n(1)具有医药卫生专业大学专科以上学历证书。\n(2)具有非医药卫生专业大学专科以上学历证书，连续从事本职业或相关职业工作2年以上，经三级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(3)具有医药卫生专业中等专科以上学历证书，连续从事本职业或相关职业工作3年以上，经三级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(4) 2019年毕业的医药卫生相关专业大专以上应届毕业生【注：医药生相关专业三年级在校生（大专）或四年级/五年级在校生（本科）；在读硕士/博士研究生如本科/硕士学历为医药卫生相关专业亦可报考】。\n二级健康管理师报考条件\n——具备以下条件之一者可以申报二级健康管理师\n(1)取得三级健康管理师正规培训达规定标准学时数，连续从事本职业或相关职业工作5年以上。\n(2)取得三级健康管理师职业资格证书后，连续从事本职业工作4年以上，经健康管理师二级正规培训达规定标准学时数，并取得结业证书。\n(3)具有医药卫生专业本科学历证书，取得三级健康管理师职业资格证书后，连续从事本职业工作4年以上。\n(4)具有医药卫生专业本科学历证书，取得健康管理师三级职业资格证书后，连续从事本职业工作3年以上，经二级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(5)具有医药卫生专业中级及以上专业技术职务任职资格后，经二级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(6)具有医药卫生专业硕士研究生及以上学历证书，连续从事本职业或相关职业工作2年以上。\n一级健康管理师报考条件\n——具备以下条件之一者可以申报一级健康管理师\n(1)取得二级健康管理师职业资格证书后，连续从事本职业工作4年以上。\n(2)取得二级健康管理师职业资格证书后，连续从事本职业工作3年以上，经一级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(3)具有医药卫生专业本科学历证书，连续从事本职业或相关专业工作13年以上。\n(4)取得医药卫生专业副高级及以上专业技术职务任职资格后，经一级健康管理师正规培训达规定标准学时数，并取得结业证书。\n(5)具有医药卫生专业硕士、博士研究生学历证书，连续从事本职业或相关职业工作10年以上。',NULL,2,73,1,1,0,0,'2019-12-03 15:05:10',0,'2019-12-03 07:05:10','2019-12-03 15:05:10',NULL,NULL),(543,'营养师','营养师（英文：dietitian）职业的出现，是适应社会健康的需求而产生的。营养师的职业综合了厨师、保健师、医务、中医、心理师、营销员、管理员等职业的特点于一身，是比较综合的职业。他们不但是食物的专家，更是营养检测、营养强化、营养评估等领域的专家，帮助人们获取健康。营养师的职业要求是专心专业服务于健康。\n职业概况\n国民营养与健康状况是反映一个国家或者地区经济与社会发展、卫生保健水平和人口素质的重要指标。良好的营养和健康状况既是社会经济发展的基础，也是社会经济发展的目标。\n随着我国国民经济的持续快速发展，自2003年以来，我国城乡居民的膳食、营养状况有了明显改善，但与此同时，我国也面临着营养缺乏与营养结构失衡的双重挑战。高血压、糖尿病、冠心病等与膳食营养密切相关的疾病日益威胁人们的健康，因此，结合我国食物资源的具体情况，大力开展营养工作，引导我国居民参与及改善营养膳食搭配是我们面临的一个非常紧迫的任务。\n营养师的工作非常重要。他（她）们通过科学合理地调配大众的饮食及促进人们的身体健康，减少各种慢性病的发生，并通过向全社会全面普及营养知识，提高全民营养意识，以达到增强全民身体素质的目的。\n在美国，凡是住院病人的治疗都必须有营养师的参与。在日本，每300人就拥有一名营养师，营养师的数量相当于临床医师的2.4倍。如果按照日本营养师占全国人口的比例，即每300人配备1名营养师来推算，我国缺少400万名营养师。目前我国营养师不足4000人，大中专院校没有设立专门营养专业，与此职业相关的专业人员培养根本不能够满足社会的需求。相比于发达国家，我国在营养方面的专业人才相当匮乏。\n为此，营养师这一新兴职业应社会之需要产生发展并趋于成熟，国家正式确立此职业，对于规范本职业的从业行为，提高从业者职业能力，为我国建设一支专门的营养方面专业人才队伍将起到积极作用。\n开展相应的公众营养改善工作，是一项提高国民健康素质和提升国家综合国力的系统工程。与营养改善密切相关的营养产业也是一个具有生命力和发展潜力的朝阳产业。以营养产业发展为前提，营养改善工作的主要内容有：儿童、妇女和婴幼儿、老年人等三个重点人群的营养改善工作；贫困地区人口、最低生活保障人群的营养扶贫与营养脱贫工作；城市和经济发达地区肥胖、高血压、糖尿病等“富贵病”人群的营养改善工作；在学生中开展营养教育工作；从事公众营养、人口素质与社会经济发展之间关系的研究、咨询及宣传；在营养工作相关部门、单位、企业间进行沟通协调；以营养科学为指导开拓食品工业发展的新领域，大力推进营养强化食品等营养产业的发展等等。\n我国的产业结构、消费结构、居民饮食结构、疾病模式等正处于转型期。在党和政府的有力领导下，采取正确的方针政策，各部门的协同配合，并充分调动、依靠社会各界的积极力量，通过不懈的努力，一定会取得全民族营养健康状况明显改善的丰硕成果。\n营养师从事的工作内容：进行膳食调查和评价，结合对象的实际需要进行营养管理和营养干预；进行人体营养状况的测定、评价、管理与指导；对被测试对象的日常膳食营养状况进行评价、管理和指导；对被测试对象每日摄取的各类食品及其相关配方进行营养评价；对社区民众进行营养知识的咨询与普及宣传教育。',NULL,2,73,1,1,0,0,'2019-12-03 15:08:45',0,'2019-12-03 07:08:45','2019-12-03 15:08:45',NULL,NULL),(544,'色彩搭配师','运用色彩专业知识和技能，从事色彩搭配与设计、色彩策划与营销、色彩调查与管理、色彩研究与咨询的人员。 色彩搭配师通过色彩测量、色彩咨询、色彩调查、色彩研究与培训等工作为社会提供专业化的色彩服务，提升各领域色彩设计与应用的能力。 色彩搭配师这一职业在一些发达国家已相当成熟。日本全国有近40万名色彩搭配设计师；美国、英国等国家的色彩设计公司都拥有一批专门的色彩设计人员，专业色彩搭配设计师活跃在纺织、服装、室内、环境、工业产品、电子产品、涂料、汽车、食品等各行业领域。\n职业简介\n近些年来的发展，尽管从事色彩搭配专业工作的人员在不断增加，但数量还是远远不能满足现实需求。色彩搭配师可应用于商业领域的所有行业，但迎合社会的发展及企业需要的专业色彩人才却非常缺乏。而中国作为制造和消费大国，需要企业具备较强的自主创新能力，色彩应用作为一种新型实用学科，未来几年色彩搭配师的职业需求至少在百万人以上，届时将以更新颖的科技创新能力迅速为企业解决品牌建设、产品结构、产品开发设计到终端店面形象及特别销售的问题。\n生活中我们触手可及的每一件事物，都与色彩搭配息息相关。提起色彩搭配，许多人首先会想到的是形象设计师指导顾客如何搭配衣服的颜色，但现实情况并非局限于此。作为一个新兴的职业，色彩搭配师已经走进了我们生活的方方面面，除了我们所熟悉的服装色彩搭配外，大众公司新甲壳虫汽车、苹果公司、佳能\"你好色彩\"系列照相机、LG的\"多彩棒棒糖\"手机等国际化的大公司和成功的产品，都把色彩运用于产品研发乃至营销等各个环节。 总的来说，随着职业发展，色彩搭配师正逐渐兴起，就业前景非常看好，薪酬水平不会比同等级的设计师低，在各行业领域占据着无可替代的地位。',NULL,2,73,1,1,0,0,'2019-12-03 15:10:47',0,'2019-12-03 07:10:47','2019-12-03 15:10:47',NULL,NULL),(545,'色彩搭配师职业需求','色彩搭配师在国外是个既时髦又有身份的职业，在日本一个色彩搭配师的年收入20万元人民币以上。我国有色彩搭配师资格的人数总共2000余人，在厦门更是凤毛麟角。保守估计，我国色彩搭配师需求应有10—20万人。\n相关人士介绍，美容美发、服装服饰业，只是就局部进行打扮，不考虑是否符合人的整体特点，因此无法给予爱美的人以全面解决之道。色彩搭配师可以通过对人们的整体形象进行全面改善和提升，这一新兴职业迎合了现代人的生活需求，具有广阔的市场前景。\n市场经济的发展，为人们带来了极为丰富的商品。对于购买者来说，当商品的技术含量趋于相同时，最吸引他们眼球的，往往是商品通过色彩这一视觉要素传达的外观色彩印象。',NULL,2,73,1,1,0,0,'2019-12-03 15:13:38',0,'2019-12-03 07:13:38','2019-12-03 15:13:38',NULL,NULL),(546,'祖国强盛',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-4/7-25-8-VID_20191203_215455.mp4',1,78,1,1,0,8,'2019-12-04 07:25:37',0,'2019-12-16 02:57:07','2019-12-04 07:25:37',NULL,NULL),(547,'防止艾滋病（后文）','1. 一般性症状。持续发烧、虚弱、盗汗、全身浅表淋巴结肿大,体重下降,在3个月之内可达10%以上,最多可降低40%,病人消瘦特别明显。',NULL,2,78,1,1,0,0,'2019-12-04 07:27:53',0,'2019-12-03 23:27:53','2019-12-04 07:27:53',NULL,NULL),(548,'防止艾滋病（后文）3','2. 呼吸道症状。长期咳嗽、胸痛、呼吸困难,严重时痰中带血。',NULL,2,78,1,1,0,0,'2019-12-04 07:28:36',0,'2019-12-03 23:28:36','2019-12-04 07:28:36',NULL,NULL),(549,'防止艾滋病（后文）4','3. 消化道症状。食欲下降、厌食、恶心、呕吐、腹泻,严重时有便血。通常用于治疗消化道感染的药物对这种腹泻无效。',NULL,2,78,1,1,0,0,'2019-12-04 07:29:08',0,'2019-12-03 23:29:08','2019-12-04 07:29:08',NULL,NULL),(550,'防止艾滋病（后文5）','4. 神经系统症状。头晕、头痛、反应迟钝、智力减退、精神异常、抽风、偏瘫、痴呆等。',NULL,2,78,1,1,0,0,'2019-12-04 07:29:40',0,'2019-12-03 23:29:40','2019-12-04 07:29:40',NULL,NULL),(551,'这就是长大吧☀️',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-4/9-3-22-SVID_20191204_085427_1.mp4',1,77,1,1,0,24,'2019-12-04 09:04:22',0,'2019-12-24 05:51:17','2019-12-04 09:04:22',NULL,NULL),(552,'技巧',NULL,'http://qiniuyun.yi8kk3.cn/201