qiniuyun.yi8kk3.cn/2019-11-6/7-17-50-983d873df2c973621cc9dc2b4286db94.mp4',1,78,1,1,0,10,'2019-12-06 07:17:58',0,'2019-12-16 23:48:18','2019-12-06 07:17:58',NULL,NULL),(572,'天道酬勤',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-6/7-19-9-51a4fa69-f3ab-4445-b08a-d90f045ec5d4.mp4',1,78,1,1,0,12,'2019-12-06 07:19:41',0,'2019-12-24 05:51:13','2019-12-06 07:19:41',NULL,NULL),(573,'努力了不一定有回报，但是不努力，一定没有回报',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-6/7-20-30-3a1386ae-2e19-4aad-9d5e-981f8647949b.mp4',1,78,1,1,0,10,'2019-12-06 07:20:39',0,'2019-12-24 05:49:57','2019-12-06 07:20:39',NULL,NULL),(574,'预防艾滋病到底有多重要后文（8）','我们作为大学生预防艾滋病，当然是刻不容缓，  其实艾滋病真的离我们很近很近，所以我觉得全民预防艾滋病非常重要，希望研究艾滋病的工作者能尽快研发出治疗艾滋病的相关药品，不再让那么多人饱受艾滋病的折磨与痛苦。',NULL,2,78,1,1,0,0,'2019-12-06 07:22:43',0,'2019-12-05 23:22:43','2019-12-06 07:22:43',NULL,NULL),(575,'预防艾滋病到底有多重要后文（9）','最后配上我的全国艾滋病预防知识竞赛奖状',NULL,2,78,1,1,0,0,'2019-12-06 07:24:28',0,'2019-12-05 23:24:28','2019-12-06 07:24:28',NULL,NULL),(576,'预防艾滋病到底有多重要全文','提问：防止艾滋病到底有多重要\n最近听到一个故事，一个同学的朋友，家经挺殷实的，家里对他的期望挺大的，但是学习不怎么好，一次和一群社会青年一起去KTV唱歌，不幸染上了艾滋病，起初他还不知道，后来他动不动就生病，动不动就感冒，去医院体检，才检查出来，有艾滋病，当时他还在学校里，他家里人听说这件事情以后，让他赶快回来，他接了一次电话，以后就再也没有了音讯，最后他跳楼了，听到这个消息以后，我非常的震惊，艾滋病离我们真的非常非常的近，一个十几岁的青少年，他本该拥有灿烂的青春，但是就这样结束了生命，实在让人心痛，我参加过一次艾滋病知识竞赛，觉得普及有关艾滋病的知识非常的重要，这次就在这里给大家普及一下艾滋病的相关知识\n        艾滋病是由人类免疫缺陷病毒（英文缩写为HIV）引起。HIV是一种极为细小的球形病毒，当它进入人体后主要寄生于免疫系统的T4淋巴细胞内，最终致全身免疫力渐渐丧失,导致并发症而死亡。',NULL,2,78,1,1,0,0,'2019-12-06 08:10:41',0,'2019-12-06 00:10:41','2019-12-06 08:10:41',NULL,NULL),(577,'勇敢生活',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-6/12-39-7-SVID_20191206_123251_1.mp4',1,77,1,1,0,3,'2019-12-06 12:39:42',0,'2019-12-06 05:54:49','2019-12-06 13:54:49','2019-12-06 13:54:49',NULL),(578,'咕咕咕咕',NULL,'http://qiniu.pxuexi.com/2019-11-6/13-54-1-2154e91e0b86f13579407981f7ee1cac.mp4',1,84,1,1,0,1,'2019-12-06 13:54:10',0,'2019-12-06 05:54:42','2019-12-06 13:54:42','2019-12-06 13:54:42',NULL),(579,'改成',NULL,'http://qiniu.pxuexi.com/2019-11-6/14-17-49-2154e91e0b86f13579407981f7ee1cac.mp4',1,84,1,1,0,0,'2019-12-