019-12-08 15:21:49',NULL,'00:07'),(601,'舞动粉彩',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-8/15-22-8-VID_20191206_195524.mp4',1,78,1,1,0,12,'2019-12-08 15:23:45',0,'2019-12-24 05:49:52','2019-12-08 15:23:45',NULL,'00:10'),(602,'精彩魔术',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-8/15-24-26-VID_20191206_193535.mp4',1,78,1,1,0,8,'2019-12-08 15:25:22',0,'2019-12-16 02:56:39','2019-12-08 15:25:22',NULL,'00:10'),(603,'活力无限',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-8/15-26-8-VID_20191206_192906.mp4',1,78,1,1,0,6,'2019-12-08 15:27:42',0,'2019-12-16 03:15:17','2019-12-08 15:27:42',NULL,'00:02'),(604,'有自己的坚守',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-8/18-39-18-SVID_20191207_231555_1.mp4',1,77,1,1,0,9,'2019-12-08 18:39:36',0,'2019-12-24 05:49:48','2019-12-08 18:39:36',NULL,'00:41'),(605,'基辛格秘密访华','基辛格秘密访华，指的是1971年7月9日，基辛格由巴基斯坦转道，在北京和周恩来举行会谈，并就尼克松访华、中美关系正常化问题交换了意见的一次秘密访问。\n\n1971年中美两国还处于敌对状态，但是由于中苏关系恶化、美苏争霸中美国处于劣势，中美两国都需要加强两国的沟通和交流，从而牵制苏联。但是由于中美意识形态不同、分属于两大社会阵营等原因，中美的交往不能贸然进行，要有所准备和铺垫。所以为了打开中美交往的大门，基辛格秘密访华，为的就是为尼克松访华探路，准备前提条件。\n\n背景过程\n1969年尼克松就任美国总统后有两桩心事：一是搞点什么惊人之举使自己名垂青史；二是设法连任下届总统。对外首先考虑的就是：主动同中国和好；借助中国从越南脱身和抗衡苏联。因此，他上台后的第一道命令就是要国家安全事务助理基辛格博士“探索重新同中国人接触的可能性”。69年中苏珍宝岛事件后，尼克松认为时机成熟，在7月出访亚、欧前夕，宣布对中国放宽人员来往和贸易交流的限制。在出访过程中，尼克松请巴基斯坦和罗马尼亚总统向中国领导人传话，希望同中国对话。\n1970年10月25日，尼克松在白宫会见巴基斯坦总统叶海亚·汗时提出，中美关系十分重要，他要走向同中国和好。美国绝不会同苏联合谋反对中国，愿派一高级使节秘密访问中国。请叶海亚·汗作中介人提供协助。叶海亚·汗欣然表示同意。\n\n基辛格秘密访华\n不久，叶海亚·汗到中国访问。11月10日他同周总理单独会见时传达了尼克松口信，说尼克松要走向同中国和好，愿意同中国进行有限的贸易；美国希望在高一级进行秘密对话，并准备派一名高级使节人士和墨菲、杜威在任何时候和任何地方同中国对话。尼克松还暗示，如果中国要在官方一级会谈，他可以派主要顾问基辛格前往。他迫切等待中国的答复。周总理于11月14日正式答复叶海亚·汗说：“阁下清楚，台湾是中国不可分割的领土，解放台湾是中国的内政，不容外人干预。美国武装力量占领台湾和台湾海峡，是中美关系紧张的关键问题。如果尼克松真有解决上述关键问题的愿望和办法，中国政府欢迎美国特使来中国商谈。时机可能通过巴基斯坦总统商定。叶海亚·汗回国后即派专人将周总理的答复口信（无头衔、无签字的手抄备忘录）派专人送给巴基斯坦驻美大使，嘱其口头转达给基辛格。不久，基辛格答复，美国同意接受邀请，准备在北京举行高级会谈，讨论包括台湾在内的存在于美中之间的名种各样的问题。\n在叶海亚·汗总统的热情帮助下，基辛格经过精心安排，于7月1日开始了他的“波罗”行动。为了转移人们的视线，白宫新闻秘书在例会上宣布：“尼克松总统即将派基辛格博士于7月2日至5日到越南南方执行调查事实的任务，随即到巴黎同戴维·布鲁斯磋商。在基辛格赴巴黎途中，他将同泰国、印度和巴基斯坦官员们会谈。”\n基辛格于7月1日离开华盛顿，在西贡活动了三天，到曼谷停留一天。6日到达新德里，8日到伊斯兰堡。为了不使印度不高兴，宣布在巴基斯坦也只呆两天。但为了秘密访华他在8日晚宴上，伪装肚子痛。叶海亚·汗总统特高声宣布，伊斯兰堡天气太热，影响基辛格的健康，请他去那蒂亚加利的总统别墅休养，以摆脱记者的追逐。基辛格在九日凌晨四时半同章文晋等陪同乘巴基斯坦民航707飞机直飞北京。当天12时15分到达北京南苑机场。周总理派叶剑英、黄华、熊向晖和韩叙等到机场迎接。',NULL,2,73,1,1,0,0,'2019-12-08 19:08:33',0,'2019-12-08 11:08:33','2019-12-08 19:08:33',NULL,NULL),(606,'知识社会利器，准精英必备学习工具—费曼技巧','作者：奔跑的小牛\n\n我们正处于知识越来越贵的时代，学习力是未来个人发展最主要的竞争实力。\n\n当我们走出校园，没有了老师和同学的氛围，还能不能一如既往的保持高效率的学习，能不能比别人更好更快的掌握技能？在职场上能不能比别人更快的晋升，能不能适应飞速发展的知识社会？\n\n在以后的日子里，小牛讲用十篇成长系列的文章，来和大家一起，提升自我，改变自我，\n\n01知识精英费曼\n\n\n\nRichard Phillips Feynman\n\n\n\n\n理查德·菲利普斯·费曼（Richard Phillips Feynman），出生于1918年5月11日，是美籍犹太裔物理学家，曾在1965年获得诺贝尔物理学奖，也被认为是继爱因斯坦之后最睿智的理论物理学家。\n\n费曼在普林斯顿大学讲课时，课堂上总是妙趣横生。他善于把枯燥、抽象的知识用简单化，形象化的语言精确的表达出来，前来听他上课的学生挤爆了教室。学生们记录总结的费曼物理学讲义一直被所有从事物理的人奉为经典和圣经。\n\n他喜欢在酒吧内做科学研究，桑巴鼓的造诣也很高，还在巴西国家嘉年华会上当领队贵宾。\n\n上世纪30年代参加美国制造原子弹的曼哈顿计划，因为好奇，在严密的监控下破解安全锁自娱，取得机密资料后，留下字条字条警告政府要小心安全......\n\n\n\n关于费曼的故事，其中最有名的便是费曼大闹数学系的故事。\n\n费曼在普林斯顿大学攻读物理学博士期间，有一天和那些经常故作高深的数学系博士开玩笑说：“我跟你们打赌，随便你提出一个定理，只要你用我听得懂的方式告诉我，它的假设是什么，定理内容是什么等等，我立刻可以告诉你，它是对的还是错的！”\n\n当那些数学系博士尝试把自己正在研究的高深复杂的理论或定理用直白的语言说出来，并让一个外行能听懂，他们发现非常非常困难。凡是能用大白话说出来的解释，费曼都能给出准确的判断，他还总有办法从他们的叙述中找出他们定理的漏洞。\n\n02 费曼技巧\n\n后来，费曼告诉自己的朋友，他使用的学习技巧就是不断的举实例。\n\n费曼一边仔细倾听数学博士描述定理的各项条件，一边从实际生活的角度出发，构思符合这些条件现实情况。\n\n例如他们谈到数学的“集”时，费曼便想到球，两个不相容的“集”便是两个球，然后视情况而定，球可能具有不同的颜色，长出头发或发生其他千奇百怪的状况。\n\n最后当数学博士提出他们的宝贝定理时，费曼便只需要拿定理与他长满头发的绿球比对，瞬间可以判断定理的正确性。\n\n\n知识社会利器，准精英必备学习工具\n\n他的朋友为了让其他人能掌握费曼的学习方法，总结出费曼学习操作性更强费曼技巧，总共分为四步：\n\n第一步：选择一个你想要理解的概念\n\n明确需要学习和理解的目标\n\n第二步：设想一种场景，你正要向别人传授这个概念\n\n想象一个场景或者拿一张白纸，就好像你正在教一位初次接触这个概念的学生一样，用简单的语言表达你的概念。在这个过程中，你会更清楚地意识到关于这个概念你理解了多少，以及是否还存在理解不清的地方。\n\n第三步：如果你感觉卡壳了，就回顾一下学习资料\n\n如果你感觉卡壳了，就要回到最初的学习资料并重新学习让你感到卡壳的部分，直到你领会顺畅，可以在纸上解释这个部分为止。\n\n第四步：为了让你的讲解通俗易懂，简化语言表达\n\n用你自己的语言，而不是学习资料中的语言来解释概念。你要努力简化语言表达，或者与已有的知识建立一种类比关系，以便更好地理解它。',NULL,2,73,1,1,0,0,'2019-12-08 19:14:34',0,'2019-12-08 11:14:34','2019-12-08 19:14:34',NULL,NULL),(607,'冷，但是要向前',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-9/13-59-53-VID_20191208_180957.mp4',1,78,1,1,0,13,'2019-12-09 13:59:58',0,'2019-12-27 23:01:47','2019-12-09 13:59:58',NULL,'00:04'),(608,'爱你，中国',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-9/14-0-11-VID_20191206_191143.mp4',1,78,1,1,0,5,'2019-12-09 14:00:28',0,'2019-12-12 01:57:52','2019-12-09 14:00:28',NULL,'00:07'),(609,'美美美',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-9/14-1-20-VID_20191206_143418.mp4',1,78,1,1,0,8,'2019-12-09 14:01:22',0,'2019-12-24 04:42:13','2019-12-09 14:01:22',NULL,'00:01'),(610,'来一支舞蹈啊>o<',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-9/14-3-32-VID_20191204_220924.mp4',1,78,1,1,0,12,'2019-12-09 14:05:36',0,'2019-12-24 04:58:03','2019-12-09 14:05:36',NULL,'01:17'),(611,'高质量的度过大学','学会最重要的研究，学术精神；敢于怀疑，善于发现；整体素质，世界观，价值观提高；对所学领域有一定见解和研究。\n\n我相信，大学精神的本质，并不是为了让我们变得深奥，而恰恰是恢复人类的天真。天真的人，才会无穷无尽地追问关于这个世界的道理、关于自然、关于社会。大学要造就的，正是达尔文的天真、爱因斯坦的天真、黑格尔的天真、顾准的天真，也就是那些“成熟的人”不屑一顾的“呆子气”。',NULL,2,78,1,1,0,0,'2019-12-09 14:07:22',0,'2019-12-09 06:07:22','2019-12-09 14:07:22',NULL,NULL),(612,'满怀期待',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-10/9-15-59-cacecda9c3eddebafe6bc114a6f02217.mp4',1,77,1,1,0,16,'2019-12-10 09:16:11',0,'2019-12-21 13:49:29','2019-12-10 09:16:11',NULL,NULL),(613,'谁能3分钟内背下来',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-10/13-49-46-d637d5bd-a3fc-4598-a1cb-903de0f409a7.mp4',1,78,1,1,0,9,'2019-12-10 13:50:00',0,'2019-12-16 03:26:46','2019-12-10 13:50:00',NULL,NULL),(614,'再次路过，不免感慨',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-10/13-50-16-VID_20191209_211644.mp4',1,78,1,1,0,11,'2019-12-10 13:50:27',0,'2019-12-16 23:31:50','2019-12-10 13:50:27',NULL,NULL),(615,'为什么为什么不能熬夜','熬夜相当于手动打破人体自然生物钟，那么这样做是不是就有危害呢？\n\n历史上确实有人跟题主一样不信邪，想要打破人体的自然节律，而且他们还正儿八经地拿自己的身体做起了实验。\n\n\n\n本来，我们的身体有一个自然的昼夜节律控制着生理节奏。当然啦，我们都知道正常人的生物钟周期是24小时为一天。如果画成图就长这样：',NULL,2,78,1,1,0,0,'2019-12-10 13:52:37',0,'2019-12-10 05:52:37','2019-12-10 13:52:37',NULL,NULL),(616,'为什么不能熬夜  后文','从晚上九点开始，人体就开始分泌褪黑素（一种帮助人类入睡的荷尔蒙）了，到了十点半，肠道活动会减慢。到凌晨两点的时候，正常人应该已经进入深睡眠状态了，到 4：30体温降到最低。\n\n\n\n所以如果你经常熬夜，凌晨两三点才睡觉，那么其实你就是在打破人体的自然节律，而这种自然节律是我们智人通过千百万年进化形成的。不但跟地球自转时间（太阳起落时间）相一致，可以获得更多光照，而且内在生理也形成了规律。',NULL,2,78,1,1,0,0,'2019-12-10 13:53:33',0,'2019-12-10 05:53:33','2019-12-10 13:53:33',NULL,NULL),(617,'为什么不能熬夜  后文2','作为地质工作者的他在法意边境的马古亚雷斯山脉发现了一个地下冰川洞穴。于是他决定在这里面与世隔绝修行两个月，拿自己做人体实验。\n\n\n\nSiffre 在山洞里准备了一些必备生活用品，但没有钟或者表这样可以记录时间的东西。和他一起的有两个助手，站在洞口站岗。每次斯佛尔起床、进食或准备睡觉，都会打电话来通知值班人员并估算一下此刻的时间。值班人员会记下真正的时间，但不让斯佛尔知道。',NULL,2,78,1,1,0,0,'2019-12-10 13:54:57',0,'2019-12-10 05:54:57','2019-12-10 13:54:57',NULL,NULL),(619,'嘎嘎嘎',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-10/18-13-3-2154e91e0b86f13579407981f7ee1cac.mp4',1,80,1,1,0,12,'2019-12-10 18:14:59',0,'2019-12-16 03:26:25','2019-12-10 18:14:59',NULL,NULL),(620,'老帅了',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-10/18-29-9-407a6cb624a39c44255836500e806c5b.mp4',1,85,1,1,0,28,'2019-12-10 18:29:43',0,'2019-12-24 05:49:41','2019-12-10 18:29:43',NULL,NULL),(621,'天气刚刚好',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-11/9-39-23-lv_6766502281673198855_20191211093842.mp4',1,77,1,1,0,20,'2019-12-11 09:39:39',0,'2019-12-24 04:41:34','2019-12-11 09:39:39',NULL,NULL),(622,'天气刚刚好',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-11/9-40-7-lv_6766502281673198855_20191211093842.mp4',1,77,1,1,0,15,'2019-12-11 09:40:15',0,'2019-12-24 04:35:13','2019-12-11 09:40:15',NULL,NULL),(623,'学习制作PPT',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-11/11-23-37-31106714-0fd9-4e58-a256-e38825d21bae.mp4',1,78,1,1,0,11,'2019-12-11 11:23:58',0,'2019-12-24 05:49:38','2019-12-11 11:23:58',NULL,NULL),(624,'关于考研1','我是考博前两天心态崩了，但通过15天复习最后成为同一批所报导师唯一一个过线的，希望我的经验对你有帮助。\n\n当时一共报了3个学校，几个学校考的科目都不一样，每个学校只隔了一两周的时间。我只有第一个学校复习了一个月，当时考了英语GRE就没复习考博真题，结果败在英语上了。\n\n第二个学校只有一周复习时间，结果被抽中论文盲审，改了一个周的论文，考试就打酱油了。\n\n还有15天时间从头复习第三个学校的2门专业课加英语。这个学校的专业题是针对本校教材出的，我还买了同我之前所学差异很大的新教材。',NULL,2,78,1,1,0,0,'2019-12-11 11:25:48',0,'2019-12-11 03:25:48','2019-12-11 11:25:48',NULL,NULL),(625,'考研故事2','至少教材要复习3遍吧，第一遍纯看课本，1周过去了。第二遍比着从网上搜集的零散真题看课本，4天又过去了。中间还被老师喊回去干活，到第3遍的时候，看着教材，仿佛没有印象，晚上看着看着书就开始掉泪，心态有些崩了。因为我一心打算考博，也没找工作，如果考不上就玩完了，心里压力特别大。\n\n当时和男朋友在自习室各自复习，我的泪就止不住了。我说让他陪我去院子里走走，于是就出去哭了一场。他说没关系，能复习什么样就复习什么样，尽最大努力就好，想那么多也没用。\n\n其实我知道感觉自己考不上，是源于对自己的复习水平太差的无奈，源于面对考博失败的恐惧。',NULL,2,78,1,1,0,0,'2019-12-11 11:26:21',0,'2019-12-11 03:26:21','2019-12-11 11:26:21',NULL,NULL),(626,'考研故事3','我们在做任何一个人生选择的时候，不应该是随大流，而是应该想明白自己是不是真心想去做，为什么要去做，评估一下好的结果给自己的益处是否值得去做，再问问自己能不能承受最坏的结果。如果想去做，又能承受最坏的结果时，才可以义无反顾地去做。之所以心态崩，是因为只想到了最好的结果，而不能承受最坏的结果。',NULL,2,78,1,1,0,0,'2019-12-11 11:26:51',0,'2019-12-11 03:26:51','2019-12-11 11:26:51',NULL,NULL),(627,'考研故事4','当然，如果这个选择你已经稀里糊涂地做完了，刚才这段大道理也来不及挽救什么。记得《非暴力沟通》中讲过一个小女孩，因为某件事情哭泣，她的爸爸告诉她，哭泣如果能达到目的，就继续哭，达不到目的就要想想下次怎么样能达到目的，不要做无意义的哭泣。\n\n按这个原理，应该静下心来想一想，我心态崩了对我有什么屁用？如果有用，无非就是想得安慰，没关系你肯定能过，我给你打打气，锦鲤保佑你。可是抱歉，我不会鸡汤，你自己都不相信能考上，我在这鸡汤不就是骗你吗？那你在这里崩溃，是想考上还是想放弃？如果想考上，那就放平心态，最坏的结果不过就是去找工作，说不定考上研也不一定适合你呢，能接受吗？能接受就安安静静踏踏实实再复习13天，说不定这13天你就可以产生质的飞跃呢。不能接受你也得活着啊，我可不劝你去跳楼',NULL,2,78,1,1,0,0,'2019-12-11 11:27:35',0,'2019-12-11 03:27:35','2019-12-11 11:27:35',NULL,NULL),(628,'文案','没有文案的文案',NULL,2,83,1,1,0,0,'2019-12-11 17:49:07',0,'2019-12-11 09:49:07','2019-12-11 17:49:07',NULL,NULL),(629,'学习啦','跟我一起和学霸学习',NULL,2,83,1,1,0,0,'2019-12-11 17:50:14',0,'2019-12-11 09:50:14','2019-12-11 17:50:14',NULL,NULL),(630,'学日语基础','日语五十音图来啦',NULL,2,83,1,1,0,0,'2019-12-11 17:51:33',0,'2019-12-11 09:51:33','2019-12-11 17:51:33',NULL,NULL),(631,'工程制图课',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-12/14-53-35-3090485a-96b8-4dee-a783-177536b0ab92.mp4',1,78,1,1,0,8,'2019-12-12 14:53:44',0,'2019-12-16 04:05:36','2019-12-12 14:53:44',NULL,NULL),(632,'重温三峡大坝的建造过程',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-12/14-53-52-VID_20191210_162039.mp4',1,78,1,1,0,9,'2019-12-12 14:54:23',0,'2019-12-23 15:05:55','2019-12-12 14:54:23',NULL,NULL),(633,'大学生该有的奋斗',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-12/14-54-32-VID_20191211_215629.mp4',1,78,1,1,0,7,'2019-12-12 14:55:06',0,'2019-12-24 04:41:21','2019-12-12 14:55:06',NULL,NULL),(634,'老师超高的水准',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-12/14-55-34-fbd74735-17b9-4dae-b92f-0cbfe550ecd5.mp4',1,78,1,1,0,11,'2019-12-12 14:55:46',0,'2019-12-24 04:41:12','2019-12-12 14:55:46',NULL,NULL),(635,'学习制作视频',NULL,'http://qiniuyu