tp://qiniuyuncdn.pxuexi.com/2019-12-15/12-34-19-lv_6762047968645303560_20191214184357.mp4',1,77,1,1,0,18,'2019-12-15 12:34:32',0,'2019-12-24 05:12:11','2019-12-15 12:34:32',NULL,NULL),(656,'冬天早晨，我们不畏寒冷，哈哈，假的',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-16/6-51-15-f257f4f1-aa9c-497d-8c34-d5b2aa711ea0.mp4',1,77,1,1,0,22,'2019-12-16 07:02:25',0,'2019-12-21 02:47:30','2019-12-16 07:02:25',NULL,NULL),(657,'测试',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-16/9-33-25-VID_20191204_113906.mp4',1,86,1,1,0,1,'2019-12-16 09:33:33',0,'2019-12-21 05:48:09','2019-12-16 09:33:33',NULL,NULL),(658,'身为三峡人',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-16/11-3-19-4376a3ac-f7e1-42db-8762-0e2035e64e4c.mp4',1,78,1,1,0,7,'2019-12-16 11:03:28',0,'2019-12-16 23:31:34','2019-12-16 11:03:28',NULL,NULL),(659,'一直在想，如果键盘是中国人发明的该长什么样？',NULL,'http://qiniuyun.yi8kk3.cn/2019-11-16/11-3-48-241c3591-0e94-4cdf-be3f-269f518c0104.mp4',1,78,1,1,0,9,'2019-12-16 11:04:10',0,'2019-12-24 02:06:24','2019-12-16 11:04:10',NULL,NULL),(660,'如何提高睡眠质量1','第一个阶段和第二个阶段中，人体睡眠较浅，但是身体逐渐放松、呼吸和心率逐渐变慢。 \n　　第三个阶段和第四个阶段中，人体进入深度睡眠，人的血压，呼吸和心率都达了一天中的最低点，血管开始膨胀，白天存储在器官里的血液开始流向肌肉组织，滋养和修复它们。如果人在深度睡眠中醒来，会发现很难起床，反应慢，缺少方向感，半夜起来去洗手间甚至会不记得这件事。 \n　　第五个阶段是快速眼动阶段（Rapid Eye Movement，REM），人做梦的时候大都处在这个阶段。',NULL,2,78,1,1,0,0,'2019-12-16 11:22:27',0,'2019-12-16 03:22:27','2019-12-16 11:22:27',NULL,NULL),(661,'如何提高睡眠质量2','在对睡眠的不同阶段做了分类之后，作者提出了第一个重要的概念——睡眠周期（Sleep Cycles）。 \n　　睡眠周期是指人体在睡眠时，要多次经历睡眠的不同阶段。而其中，第一次深度睡眠的时间是所有深度睡眠的时间中最长的，随后不断缩短，或者说人体在睡着的头三四个小时里大部分是深度睡眠；第一个REM是所有REM中最短的，随后不断变长。',NULL,2,78,1,1,0,0,'2019-12-16 11:23:05',0,'2019-12-16 03:23:05','2019-12-16 11:23:05',NULL,NULL),(662,'如何提高睡眠质量3','高质量的睡眠就是大脑比较容易的进入深度睡眠阶段，并且在深度睡眠阶段保持足够久。那么，怎么获得高质量的睡眠呢，必须控制人体的睡眠生物钟',NULL,2,78,1,1,0,0,'2019-12-16 11:23:45',0,'2019-12-16 03:23:45','2019-12-16 11:23:45',NULL,NULL),(663,'测',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-16/13-55-35-1566884598142.mp4',1,87,1,1,0,0,'2019-12-16 13:55:40',0,'2019-12-16 05:55:40','2019-12-16 13:55:40',NULL,NULL),(664,'2020啊，要对我们好一点'