n.pxuexi.com/2019-12-20/17-10-56-4e4a25a1-2cf7-47a5-9ff6-0771f4559d26.mp4',1,78,1,1,0,8,'2019-12-20 17:11:03',0,'2019-12-24 05:10:23','2019-12-20 17:11:03',NULL,NULL),(694,'小哥哥好靓的鞋子',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-20/17-11-25-eb01a4f1-4657-470a-b3fc-befedb1be0ef.mp4',1,78,1,1,0,3,'2019-12-20 17:11:32',0,'2019-12-24 04:33:33','2019-12-20 17:11:32',NULL,NULL),(695,'好吧，我承认我就是来考研的',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-20/17-11-47-312d4234-8da8-4616-afb8-cdcd04d7d63c.mp4',1,78,1,1,0,7,'2019-12-20 17:11:55',0,'2019-12-21 07:06:01','2019-12-20 17:11:55',NULL,NULL),(696,'最后一定是你们，考研加油',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-20/23-56-11-lv_6761996254516956430_20191220235542.mp4',1,77,1,1,0,15,'2019-12-21 10:49:20',0,'2020-01-01 03:58:00','2019-12-21 10:48:44',NULL,NULL),(697,'大家猜一猜，我今天在什么地方？',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-21/12-47-12-4f06d107-33c6-4a51-bc96-c157afaaaaab.mp4',1,78,1,1,0,8,'2019-12-21 12:47:23',0,'2019-12-24 06:14:49','2019-12-21 12:47:23',NULL,NULL),(698,'考研党的最后一战','建议明年的小朋友们专注课本本身和时政新闻，而不是寄希望于押题卷。政治这种命题情况还是能体现一定趋势的，考研的人越来越多，需要有拉开距离的空间。\n\n不知道微博上为啥还有人真香，是看到有个熟悉的词就一股脑把肖四背得抄上去了么？？\n\n套用某位网友的话“去年考完政治出来，大呼肖四nb ，今年考完，大呼自己 nb ”\n\n专注课本，对于大题来说，是说某些原理性很强的内容，比如马原，思修法基要搞懂，万变不离其宗。',NULL,2,78,1,1,0,0,'2019-12-21 12:49:56',0,'2019-12-21 04:49:56','2019-12-21 12:49:56',NULL,NULL),(699,'分享一个考研小故事','我可能和你们都不一样吧，我是我考场第一个交卷出来的。\n\n不过是作为有害垃圾去考和交卷出来的。\n\n回想这一年，我虽然知道也有心理准备我活该这样，但死到临头还是很难受。\n\n今天早上六点半就醒来，磨蹭到了七点下床洗漱，化妆，为什么会磨蹭呢，因为我不想去了，为什么又去了呢，因为我看到乎乎小阔爱说，去考场裸考冻死自己，好反思自己这一年来的过分。为什么化妆呢，因为我想我可以输得不体面，但要败得漂亮。',NULL,2,78,1,1,0,0,'2019-12-21 17:10:23',0,'2019-12-21 09:10:23','2019-12-21 17:10:23',NULL,NULL),(700,'分享一个考研小故事2','考场在另一个校区的教学楼六楼，我真怕我考完出来为了不和大家挤楼梯一跃而下。我没吃早饭就去了，这一路是我走过的最不平坦的路，我怕得要死，一边走一边哭，两腿一边打颤，责怪自己为什么不努力。我想我真是太勇敢了，什么都不会就敢去考场送死。快到的时候我看到中心湖里的白天鹅群，有几只特别不怕人的，距离我只有50cm，它的头上有两撮棕色的羽毛，很可爱。遗憾的是没看到我们的校宝黑天鹅。',NULL,2,78,1,1,0,0,'2019-12-21 17:10:55',0,'2019-12-21 09:10:55','2019-12-21 17:10:55',NULL,NULL),(701,'分享一个考研小故事3','快要进考场的时候我的情绪还是很不好，直到那个检查证件的老师问我说，“妹妹怎么了？”我说没有事，眼里进沙子了。\n\n好在考场有三个同专业的同学，做选择题的时候没有那么难受，但也只能是看着哪个顺眼选哪个。到大题，完全没背，完全裸考，果然会冻死。我又想一跃解千愁了，下午又不想来了，好不容易熬到了能交卷的时候，我就我们考场第一个交了。对不起了考场的同学们，我是太垃圾了所以才交的。\n\n出来的时候还是那个老师问我说，“妹妹交卷了啊，下午记得带个头绳过来，还有早点来哦。”然后我想还是去吧，要早点去，还要带个头绳。',NULL,2,78,1,1,0,0,'2019-12-21 17:11:42',0,'2019-12-21 09:11:42','2019-12-21 17:11:42',NULL,NULL),(702,'冬天',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-21/22-26-56-lv_6769463700588891406_20191221222616.mp4',1,77,1,1,0,10,'2019-12-21 22:27:04',0,'2020-01-01 03:57:33','2019-12-21 22:27:04',NULL,NULL),(703,'等着考研的车来接我',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-22/12-19-32-888f657e-fc8e-45f0-9f29-3b6f8d39feee.mp4',1,78,1,1,0,5,'2019-12-22 12:19:44',0,'2019-12-24 02:21:18','2019-12-22 12:19:44',NULL,NULL),(704,'今天考数学，加油(ง •̀_•́)ง',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-22/12-20-1-b37118f8-017e-4c5b-b7af-287e369e4a81.mp4',1,78,1,1,0,4,'2019-12-22 12:20:12',0,'2019-12-24 04:33:44','2019-12-22 12:20:12',NULL,NULL),(705,'考研小技巧1','很多2020考研的同学都问，老师什么专业好考，选择什么学校比较好，说真的，每次都跟同学们说，考研没有任何专业好考，只有说相对比较冷门的专业，以及冷门的院校招收这个专业，所以，整理了这篇文章，希望对大家能有所帮助\n\n对于一些对名校执着的考生，但是实际分数又不太尽如人意的时候可以多关注一些院校信息，每年都有一些院校的某些专业招不满，不妨考虑看看：',NULL,2,78,1,1,0,0,'2019-12-22 12:21:53',0,'2019-12-22 04:21:53','2019-12-22 12:21:53',NULL,NULL),(706,'考研小技巧','【北京大学】\n\n　　城市与环境学院：自然地理学专业\n\n　　信息工程学院：计算机应用技术\n\n　　【清华大学】\n\n　　【数学科学系】：应用统计(专硕)\n\n　　【化学系(深研院)】：化学、化学生物学(制药)\n\n　　【微纳电子系】：集成电路工程(专硕)\n\n　　【地球系统科学研究中心(地学中心)】：大气科学\n\n　　【软件学院】：软件工程(专硕)\n\n　　【精密仪器系(深研院)】：仪器仪表工程(专硕)\n\n　　【医学院】：生物医学工程(含专硕)\n\n　　【航天航空学院】：生物力学、固体力学\n\n　　【工程物理系】：物理学、核科学与技术、安全科学与工程、安全工程(专硕)、核能与核技术工程(专硕)\n\n　　【复旦大学】\n\n　　说明：未找到复旦大学2015调剂信息，以下是2014和2016这两年都没招满的专业。\n\n　　【先进材料实验室】：高分子化学与物理(2014/2016)\n\n　　【软件学院】：计算机软件与理论、软件工程(专硕)(2014/2016)\n\n　　【社会发展与公共政策学院】：人口、资源与环境经济学(2014/2016)、人口学(2014/2016)、人类学(2014/2016)\n\n　　【马克思主义学院】：中共党史(2014/2016)\n\n　　【上海交通大学】\n\n　　【生物医学工程学院】：生物医学工程(专硕)\n\n　　【微纳电子学系】：集成电路工程(专硕)、电子与通信工程(专硕)\n\n　　【同济大学】\n\n　　【物理科学与工程学院】：光学工程\n\n　　【华东师范大学】\n\n　　【河口海岸科学研究院】：生物科学与技术相关专业\n\n　　【法律系】：法律(非法学)\n\n　　【物理学系】：无线电物理\n