'2019-12-23 09:13:08',NULL,NULL),(712,'考研过后3','从教育部发布的信息了解到今年全国共有341万人报考研究生，比去年增长51万，这个数字看似很惊人，但实际上很多人报名考研的只是走个形式罢了。\n\n\n现在的社会舆论把考上名校研究生视为“向上流动”。这和高考考上名校是“向上流动”如出一辙。这种“向上流动”的理论裹挟很多人都投入考研，甚至不考研已经列入了山东新“四不孝”，不考研等于不上进。\n\n在这种情况下很多人可能都是抱着试试看的想法，并没有好好复习，所以也没必要从报名人数上给自己太大的压力。\n\n愿你在合上笔的那一刻， 犹如战士收刀入鞘的骄傲，如愿以偿，成功上岸！\n\n\n\n\n想想明年的这个时候我也要踏上考研的战场，心中多了一丝畏惧，不知道未来的这一年里我又会经历怎么样的洗礼。\n\n高考没能考上称心如意的大学，我知道如果不跳出现在这个圈子大概只能浑浑噩噩度过这一生了，通过读书可能是实现我跨越阶层最好的方法。\n\n而考研，或许是脚下的第一步，同时也是像我这样普通人追寻优秀者又一个站在同一起跑线上平等的机会，也许前方充满荆棘与坎坷，但是我会努力下去，因为我深知：\n\n我没有任何背景\n我想成为家人的背景\n我有野心，不甘平凡',NULL,2,78,1,1,0,0,'2019-12-23 09:14:06',0,'2019-12-23 01:14:06','2019-12-23 09:14:06',NULL,NULL),(713,'考研结束后，冷清的校园',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-23/9-42-52-fdc06983-8731-4bf8-9fc2-853b679ebf92.mp4',1,78,1,1,0,7,'2019-12-23 09:43:06',0,'2019-12-27 23:03:32','2019-12-23 09:43:06',NULL,NULL),(714,'钢筋混凝土','钢筋混凝土搅拌车',NULL,2,94,1,1,0,0,'2019-12-24 10:20:04',0,'2019-12-24 02:20:04','2019-12-24 10:20:04',NULL,NULL),(715,'中午的男生寝室',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-24/12-17-56-0c2a0d57-4d59-4e3e-bd9e-f22adfd7f7dd.mp4',1,78,1,1,0,4,'2019-12-24 12:18:12',0,'2019-12-27 23:02:29','2019-12-24 12:18:12',NULL,NULL),(716,'看我们这干净的洗手台',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-24/12-18-30-f92e3bb6-8c8e-4d0c-933b-98f1ae458aba.mp4',1,78,1,1,0,24,'2019-12-24 12:18:40',0,'2020-01-01 03:56:52','2019-12-24 12:18:40',NULL,NULL),(717,'测试','测试',NULL,2,86,1,1,0,0,'2019-12-24 14:10:20',0,'2019-12-24 06:10:20','2019-12-24 14:10:20',NULL,NULL),(718,'商讨秘密会议',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-24/14-47-55-648890b0-9570-43fc-94ba-517313e4c652.mp4',1,78,1,1,0,3,'2019-12-24 14:48:10',0,'2019-12-27 23:02:25','2019-12-24 14:48:10',NULL,NULL),(719,'独自探寻秘密小路',NULL,'http://qiniuyuncdn.pxuexi.com/2019-12-24/14-48-27-97a8093f-71e8-447b-aa23-efc0a707736d.mp4',1,78,1,1,0,2,'2019-12-24 14:48:44',0,'2020-01-01 03:56:37','2019-12-24 14:48:44',NULL,NULL);
