DROP TABLE IF EXISTS `top_search_orders`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!40101 SET character_set_client = utf8 */;
CREATE TABLE `top_search_orders` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `title` varchar(255) NOT NULL COMMENT '标题',
  `post_id` int(22) NOT NULL COMMENT '资源id',
  `nickname` varchar(255) NOT NULL,
  `member_id` int(11) NOT NULL COMMENT '用户id',
  `price` varchar(255) NOT NULL,
  `expense` int(255) NOT NULL COMMENT '费用',
  `top_time_limit` int(100) NOT NULL COMMENT '置顶时长',
  `top_end_time` datetime NOT NULL COMMENT '置到期时间',
  `transfer_type` varchar(255) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `updated_at` datetime DEFAULT NULL,
  `account_log_id` int(20) NOT NULL COMMENT '消费记录表id',
  `is_pay` int(1) DEFAULT '0' COMMENT '支付状态0未支付1支付',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COMMENT='置顶订单表';
